import Start from "./Start";
import { Link } from "react-router-dom";

function Register() {
  return (
    <Start>
      startTitle='Регистрация'
      <form className="start__form" name="form" novalidate>
        <input id="" className="start__input" type="email" placeholder="Email" required />
        <input id="" className="start__input" type="password" placeholder="Пароль" minlength="8" maxlength="15" required />
        <button className="popup__button popup__button_type_card" type="submit">Зарегистрироваться</button>
      </form>
      <div className="start__sign-in">
          <p>Уже зарегистрированы?</p>
          <Link to="/sign-in" className="start-link">Войти</Link>
      </div>
    </Start>
  );
}

export default Register;
